var drawPath = function (path) {
	// var layers = [];
	for (var i = 1; i < path.length; i ++){
		var s = [path[i-1][0],path[i-1][1]];
		var d = [path[i][0],path[i][1]];
		var type = path[i][3];
		var index = data_type.indexOf(type);
		var layer = L.polyline([s,d] , {color: pColor[index]});
		layer.on({
			'mouseover': function (e){
				console.log(type);
			}
		});
		// layers.push(layer);
		layer.addTo(self.map);
	};
	// var group = L.layerGroup(layers);
	// self.map.addLayer(group);
};
var initWind = function(){
    data_type.forEach(function (type){
			$.getJSON(data_path + data_date + '/' + type + '.json', function (data) {
			self.velocityLayer = L.velocityLayer({
				displayValues: true,
				displayOptions: {
					velocityType: type,
					displayPosition: 'bottomleft',
					displayEmptyString: 'No wind data'
				},
				data: data,
				maxVelocity: 10
			});
			layerControl.addOverlay(velocityLayer, type);
			if(type === '80mab'){
				velocityLayer.addTo(self.map);
			}
		});
	});
};
var switchLayer = function(point, nextLayer){

	nextLayer.addTo(self.map);
	nextLayer.setPath(point);
}

